import React,{Component} from "react";
import {View,Text} from "react-native";

class Category extends Component{
    constructor(props){
        super(props)
    }

    renderSubCategories = (categoryName) => {
        console.log(categoryName.toLowerCase());
    }

    render(){
        const {categoryName} =  this.props.route.params.categoryName;
        return(
            <View>
               <Text>This is the category name {categoryName}</Text>
               {
                   this.renderSubCategories(categoryName)
               }
            </View>
        )
    }
}

export default Category;
